import React from "react";

const About = () => {
  return (
    <div className="container">
      <h1>من نحن</h1>
      <p>
        نحن متجر سيارات متخصص في تقديم أفضل السيارات بأسعار منافسة وخدمة مميزة.
      </p>
    </div>
  );
};

export default About;
